CREATE VIEW "public"."workflow_execution_view" AS  SELECT we.id,
    we.workflow_id,
    we.status,
    we.runtime_config,
    we.definition,
    we.created_at,
    we.started_at,
    we.completed_at,
        CASE
            WHEN (count(s.id) = 0) THEN '[]'::json
            ELSE json_agg(s.*)
        END AS steps
   FROM (workflow_executions we
     LEFT JOIN steps s ON ((we.id = s.workflow_execution_id)))
  GROUP BY we.id;

